import "./PageCharacterList.css";
import Cards from "./Cards";

const PageCharacterList = (props) => {
  return (
    <div className="body">
      <div className="button-53">CHARACTER</div>
      <div className="container">
        <div className="row">
          <div className="col-8">
            <div className="row">
              <Cards />
              <Cards />
              <Cards />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
export default PageCharacterList;
